import React from "react";


function MobileMenu(){
    return(
        <nav class="mobile-nav">
            <a href="#home">Home</a>
            <a href="#descubra">Projetos</a>
            <a href="#guias">Skills</a>
            <a href="https://www.figma.com/file/wTh2kmW18ywNQQDIWPKDf9/Portf%C3%B3lio?node-id=13%3A24" target="_blank">Figma</a> 
            <a href="https://github.com/wpcavalcante" target="_blank"><li className="nav-item">GitHub</li></a>

        </nav>
    )
}

export default MobileMenu
